export default function updateStudentGradeByCity(array, city, newGrades) {
  const newArray = array.filter((element) => element.location === city);
  return newArray.map((element) => {
    for (const member of newGrades) {
      if (member.studentId === element.id) {
        element.grade = member.grade;
      } else {
        element.grade = 'N/A';
      }
    }
    return element;
  });
}

